import React from 'react';
import './card.css';

type CardProps = {
    showName: string,
    artistName: string,
    danceType: string,
    img: string,
    year: number,
}

type CardType = React.FunctionComponent<CardProps>
const Card: CardType = (props: CardProps) => { 
    return (
        <div className='card'>
            <div className='card-content'>
                <div>CARD</div>
                <div className>
                    <img src={props.img} alt={props.showName}/>
                </div> 
            </div>
        </div>
    ) 
}

export default Card;
